// Imports
import React, { Component } from 'react';
import './selector.css';

import Toggle from 'react-toggle';

class Selector extends Component {
  render() {
    return (
      <label>
        <Toggle
          icons={false}
        ><span>1 / 2</span></Toggle>
        <span>1 / 2</span>
      </label>
    );
  }
}

export default Selector;
